#include "gtest/gtest.h"

TEST(Test_Name_Major, Test_Name_Minor)
{
  constexpr bool evaluation = true;
  EXPECT_EQ(evaluation, true);

  EXPECT_EQ(2, 2);
  EXPECT_TRUE(2 < 3);
  EXPECT_NEAR(3, -2, 6);
}
